        private void AddLabelRow(System.Windows.Forms.TableLayoutPanel panel, string titulo, System.Windows.Forms.Label lblValor, int rowIndex)
        {
            var lblTitulo = new System.Windows.Forms.Label();
            lblTitulo.Text = titulo;
            lblTitulo.TextAlign = System.Drawing.ContentAlignment.MiddleRight;
            lblTitulo.Dock = System.Windows.Forms.DockStyle.Fill;

            lblValor.Text = "";
            lblValor.TextAlign = System.Drawing.ContentAlignment.MiddleLeft;
            lblValor.Dock = System.Windows.Forms.DockStyle.Fill;
            lblValor.BorderStyle = System.Windows.Forms.BorderStyle.FixedSingle;

            panel.RowStyles.Add(new System.Windows.Forms.RowStyle(System.Windows.Forms.SizeType.Absolute, 30F));
            panel.Controls.Add(lblTitulo, 0, rowIndex);
            panel.Controls.Add(lblValor, 1, rowIndex);
        }

